import styled from "styled-components";

const Container = styled.div`
    height: 3%;
    background-color: #F05454;
    color: white;
    display: flex;
    align-items: center;
    justify-content: center;
    font-size: 18px;
    font-weight: 500;
`

const Announcement = () => {
    return (
        <Container>
            Free Shipping on Orders over $50!
        </Container>
    )
};

export default Announcement;
